import React from 'react';
// import ReactDOM from 'react-dom';

import data from "./data.js";

import earth_image from "./images/earth_image.png";

// ðŸ˜± img src Works after moving src/images folder to public/images
function DiaryCard(props) {
  console.log(props)
  // for pass in of item={item} you can create new Object let props = prop.item
  // for pass in of {...item} don't need reassign to new Object.

  let ImageURL = (props.imageUrl.search("http") >= 0) ? ImageURL = props.imageUrl : ImageIsURL = "./images/" + props.imageUrl

  return (
    <div className="card">
      {ImageURL != "" && <div className="card--badge">{ImageURL}</div>}
      <img src={`./images/${props.coverImg}`} alt={props.title} className="card--image" />
      <div className="card--stats">
        <img src={earth_image} alt="Favorite" className="star--image" />
        <span>{props.stats.rating} </span>
        <span className="gray">({props.openSpots}) â€¢ </span>
        <span className="gray">{props.location}</span>
      </div>
      <p>{props.title}</p>
      <p><span className="bold">From ${props.price}</span> / person</p>
    </div>
  )
}

export default function MainDairy() {

  const cards = data.map(item => {
      return (
        <DiaryCard
        key={item.id}
        {...item}
        />
      )
    }
  )
  return (
      <div className="experience--grid">
      <section className="card--stats">
        {cards}
      </section>
      </div>
    )
  }
